(window.webpackJsonp=window.webpackJsonp||[]).push([[49],{611:function(module,exports){eval('module.exports = "<h1 id=\\"color-variants-and-css-class-mapping\\"><span class=\\"bd-content-title\\">Color variants and CSS class mapping</span></h1>\\n<p class=\\"bd-lead\\">Below are the variants available when using the default Bootstrap v4 CSS. When using BootstrapVue\\ncomponents, the variants are referred to by their variant name, rather than by the underlying CSS\\nclassname</p>\\n<h2 id=\\"base-variants\\"><span class=\\"bd-content-title\\">Base variants<a class=\\"anchorjs-link\\" href=\\"#base-variants\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">primary</code> - <span class=\\"text-primary\\">Primary</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">secondary</code> - <span class=\\"text-secondary\\">Secondary</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">success</code> - <span class=\\"text-success\\">Success</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">warning</code> - <span class=\\"text-warning\\">Warning</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">danger</code> - <span class=\\"text-danger\\">danger</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">info</code> - <span class=\\"text-info\\">Info</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">light</code> - <span class=\\"text-light\\">Light</span></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">dark</code> - <span class=\\"text-dark\\">Dark</span></li>\\n</ul>\\n<p>The base variants will translate to various Bootstrap v4 contextual class names based on the\\ncomponent (and variant purpose) where they are used.</p>\\n<h2 id=\\"background-and-border-variants\\"><span class=\\"bd-content-title\\">Background and border variants<a class=\\"anchorjs-link\\" href=\\"#background-and-border-variants\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>All the <strong>base variants</strong> plus:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">transparent</code></li>\\n</ul>\\n<p>These translate to class names <code translate=\\"no\\" class=\\"notranslate\\">bg-&lt;variant&gt;</code> for backgrounds and <code translate=\\"no\\" class=\\"notranslate\\">border-&lt;variant&gt;</code> for borders.</p>\\n<p>These variants are used by components (such as <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-card&gt;</code>, <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-jumbotron&gt;</code> and <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-modal&gt;</code>) that\\nprovide <code translate=\\"no\\" class=\\"notranslate\\">bg-variant</code>, <code translate=\\"no\\" class=\\"notranslate\\">*-bg-variant</code>, <code translate=\\"no\\" class=\\"notranslate\\">border-variant</code> and <code translate=\\"no\\" class=\\"notranslate\\">*-border-variant</code> props</p>\\n<h2 id=\\"text-variants\\"><span class=\\"bd-content-title\\">Text variants<a class=\\"anchorjs-link\\" href=\\"#text-variants\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>All the <strong>base variants</strong> plus:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">muted</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">white</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">black</code></li>\\n</ul>\\n<p>These translate to class names <code translate=\\"no\\" class=\\"notranslate\\">text-&lt;variant&gt;</code></p>\\n<p>These variants are used by components (such as <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-card&gt;</code>, <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-jumbotron&gt;</code> and <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-modal&gt;</code>) that\\nprovide <code translate=\\"no\\" class=\\"notranslate\\">text-variant</code> and <code translate=\\"no\\" class=\\"notranslate\\">*-text-variant</code> props</p>\\n<h2 id=\\"component-specific-variants\\"><span class=\\"bd-content-title\\">Component specific variants<a class=\\"anchorjs-link\\" href=\\"#component-specific-variants\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Some Bootstrap v4 components require additional CSS styling, or additional pseudo selector styling\\n(i.e buttons), and hence have their own underlying variant CSS classes.</p>\\n<h3 id=\\"alert-variants\\"><span class=\\"bd-content-title\\">Alert variants<a class=\\"anchorjs-link\\" href=\\"#alert-variants\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>All the <strong>base variants</strong></p>\\n<p>These translate to class names <code translate=\\"no\\" class=\\"notranslate\\">alert-&lt;variant&gt;</code>.</p>\\n<h3 id=\\"badge-variants\\"><span class=\\"bd-content-title\\">Badge variants<a class=\\"anchorjs-link\\" href=\\"#badge-variants\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>All the <strong>base variants</strong></p>\\n<p>These translate to class names <code translate=\\"no\\" class=\\"notranslate\\">badge-&lt;variant&gt;</code>.</p>\\n<h3 id=\\"button-variants\\"><span class=\\"bd-content-title\\">Button variants<a class=\\"anchorjs-link\\" href=\\"#button-variants\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>All the <strong>base variants</strong> plus:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">outline-&lt;base variant&gt;</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">link</code> which renders the button with the look of a link but retains button padding and margins.</li>\\n</ul>\\n<p>These translate to class names <code translate=\\"no\\" class=\\"notranslate\\">btn-&lt;variant&gt;</code> and <code translate=\\"no\\" class=\\"notranslate\\">btn-outline-&lt;variant&gt;</code>.</p>\\n<p>Note the <code translate=\\"no\\" class=\\"notranslate\\">link</code> variant does not have an outline version.</p>\\n<h3 id=\\"table-variants\\"><span class=\\"bd-content-title\\">Table variants<a class=\\"anchorjs-link\\" href=\\"#table-variants\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>All the <strong>base variants</strong> plus:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">active</code></li>\\n</ul>\\n<p>These variants translate to class names <code translate=\\"no\\" class=\\"notranslate\\">table-&lt;variant&gt;</code>.</p>\\n<p>When the table has the <code translate=\\"no\\" class=\\"notranslate\\">dark</code> prop set, the variants translate to the <code translate=\\"no\\" class=\\"notranslate\\">bg-&lt;variant&gt;</code> classes.</p>\\n<h2 id=\\"using-variant-classes\\"><span class=\\"bd-content-title\\">Using variant classes<a class=\\"anchorjs-link\\" href=\\"#using-variant-classes\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>You may also use the underlying class names directly on elements (and some components) via the\\nstandard HTML <code translate=\\"no\\" class=\\"notranslate\\">class=&quot;...&quot;</code> attribute.</p>\\n<h2 id=\\"creating-custom-variants\\"><span class=\\"bd-content-title\\">Creating custom variants<a class=\\"anchorjs-link\\" href=\\"#creating-custom-variants\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>When creating custom variants, follow the Bootstrap v4 variant CSS class naming scheme and they will\\nbecome available to the various components that use that scheme (i.e. create a custom CSS class\\n<code translate=\\"no\\" class=\\"notranslate\\">btn-purple</code> and <code translate=\\"no\\" class=\\"notranslate\\">purple</code> becomes a valid variant to use on <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-button&gt;</code>).</p>\\n";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///611\n')}}]);